import React from "react";

export const Reviews = ({ reviews }) => {
  return (
      <div>
        {
          reviews.map(({user, text, rating }) => {
            <div>
              <div>{user}</div>
              <div>{text}</div>
              <span>{rating}</span>

            </div>
          })
        }

      </div>
  )
}
